import React,{useState} from 'react';
import { Text,View,TextInput,StyleSheet} from 'react-native';
import { Avatar,Icon } from 'react-native-elements'; 
import { Foundation } from '@expo/vector-icons'; 
import style from '../style.js';

import { connect } from 'react-redux';

export default function WishList ({item,detetion}){ 

    return (
<View style={styles.Form}>

<View style={style.second}> 

<View style={{marginLeft:15}} >
   <Avatar 
    title="PP"
     size="large"
     rounded={false}
     overlayContainerStyle={{backgroundColor: 'gray'}}
     activeOpacity={0.1}>
   </Avatar> 
 </View>

<View style={{marginRight:15,justifyContent:"center",}}>
<View style={style.title}><Text >item name </Text></View>
<View style={styles.itemsno}>
 <Text style={{marginTop:3,}}>Price: </Text>
 <TextInput 
     placeholder='2'
     editable={false}
     placeholderTextColor={'black'}
   /> 
 <Foundation name="dollar" size={20} color="black" />
 </View>
 <Icon style={{marginTop:10,marginLeft:10}}name='delete' color='gray' size={25} onPress={()=>deletion(item.key)}/>
 </View>

 </View>

</View>
    );
}

const styles = StyleSheet.create({  
    itemsno:{
      width:'auto',
      flexDirection:'row',
      marginTop:5,
      justifyContent:'center'
    },

    Form:{
      borderRadius:15,
      padding:10,
      paddingTop:30,
      paddingBottom:30, 
      backgroundColor:'white',
      height:'auto',
      shadowColor: "#000",
      shadowOffset: {	width: 0,	height: 5,},
      shadowOpacity: 0.28,
      shadowRadius: 5.00,
      elevation: 4,
      marginBottom:10
  },
  
  })
